import React from "react";

export default function Production({ productdata }) {
  console.log("Product Data:", productdata);

  return (
    <>
      <tr>
        <td>{productdata?.id}</td>
        <td>{productdata?.title}</td>
        <td>{productdata?.price}</td>
        <td>{productdata?.description}</td>
        <td>{productdata?.category}</td>
        <td>
          <img src={productdata?.image} alt={productdata?.title} width={250} />
        </td>
        <td width={200}>
          {productdata.Rating.rate} ({productdata?.Rating?.count} votes)
        </td>
      </tr>
    </>
  );
}
